abstract:
The invention relates to a process for the manufacture of network packages from reticulate webs obtained by stretching, fibrillating and spreading of a film of organic polymeric material. Network packages according the invention are obtained in that:
a. one or more reticulate webs (3), one on top of the other, are continuously supplied and laid onto a carrier (4);b. the reticulate webs are folded zig-zag on this carrier (4);c. the folded network is continuously transported in a direction virtually normal to the direction in which the reticulate webs are supplied;d. further, at one or both sides of the resultant folded network, reticulate webs are applied, which webs are stretched longitudinally and in the direction of transport, fibrillated and spread, and are supplied in the direction of transport of the folded network and joined with it;e. the resultant combination of reticulate webs is carried off;
the rate of supply of the reticulate webs to be folded and the rate of discharge of the folded reticulate webs being chosen so that the angle between two successive folded sides of reticulate webs is between 1 and 50°C and in particular between 1° and 20°.
